import React from 'react';
import { useNavigate } from 'react-router-dom';

function InitialHome() {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: 'center', marginTop: '4rem' }}>
      <h1>Welcome to Research Hive</h1>
      <p>
        Research Hive is an online platform for researchers to connect, share, and collaborate.<br />
        Register or log in to get started!
      </p>
      <div style={{ marginTop: '2rem' }}>
        <button onClick={() => navigate('/register')} style={{ marginRight: '1rem' }}>
          Register
        </button>
        <button onClick={() => navigate('/login')}>
          Log In
        </button>
      </div>
    </div>
  );
}

export default InitialHome;
